(1, 'BMW M4', 'BMW', '2014-01-01', 'F82', 30000, , 'Der BMW M4 F82 aus dem Jahr 2014 ist das erste Modell der M4-Reihe, das den legendären M3-Coupé ersetzt hat. Unter der Haube arbeitet ein 3,0-Liter-Biturbo-Reihensechszylinder (S55-Motor) mit ca. 431 PS und 550 Nm Drehmoment, was für eine beeindruckende Beschleunigung von 0–100 km/h in etwa 4,1 Sekunden sorgt.\r\n\r\nDieses spezielle Fahrzeug hatte einen Unfall, wurde jedoch fachmännisch repariert und aufwändig restauriert, um es wieder in seinen originalen Zustand zurückzuversetzen – optisch und technisch in neuwertigem Zustand. Die Karosserie wurde professionell instand gesetzt, lackiert und alle sicherheitsrelevanten Komponenten wurden überprüft oder erneuert.\r\n\r\nHeute präsentiert sich das Fahrzeug wieder in voller Stärke: sportliches Design, aggressiver Sound und Fahrerlebnis pur, wie man es von einem echten M-Modell erwartet.');
INSERT INTO `car` (`Car_id`, `Name`, `Brand`, `year_of_construction`, `Model`, `Price`, `image`, `Information`) VALUES
(2, 'Audi A6', 'Audi', '2018-05-11', 'C8', 40000, , 'Der Audi A6 C8, eingeführt ab 2018, repräsentiert die achte Generation der beliebten A6-Baureihe. Dieses Modell vereint moderne Eleganz, fortschrittliche Technik und sportliche Performance in einer Oberklasse-Limousine. Je nach Ausstattung ist er mit effizienten TFSI- oder TDI-Motoren, Mild-Hybrid-Technologie, dem quattro-Allradantrieb sowie einem digitalen Virtual Cockpit ausgestattet.\r\n\r\nBei diesem speziellen Fahrzeug handelt es sich um ein Unfallfahrzeug, das jedoch professionell instand gesetzt wurde. Die beschädigten Karosserieteile wurden fachgerecht ersetzt, alle sicherheitsrelevanten Systeme überprüft und der Wagen in Originalfarbe neu lackiert. Dabei wurde besonders auf Qualität und Werterhalt geachtet.\r\n\r\nNach der Restaurierung steht der Audi A6 C8 wieder in optisch und technisch einwandfreiem Zustand da – mit stilvollem Interieur, dynamischem Fahrverhalten und neuem Glanz. Ideal für alle, die Komfort, Prestige und modernste Technologie suchen.');

